INSERT INTO `posts` (`id`, `post_category_id`, `title`, `description`, `same_as_default`, `title_an`, `description_an`, `data_file`, `slug`, `meta_title`, `meta_description`, `status`, `created_at`, `created_by`, `updated_at`, `updated_by`) VALUES
(1, 1, 'Langkanya Minyang Goreng Dipasaran', '<p>Asosiasi Pengusaha Ritel Indonesia (Aprindo) meminta Kementerian Perdagangan (Kemendag) untuk memerintahkan para distributor untuk memasok minyak goreng ke pasar tradisional, bukan hanya ke ritel modern.&nbsp;</p>', 0, 'Langkanya Minyang Goreng Dipasaran', '<p>Asosiasi Pengusaha Ritel Indonesia (Aprindo) meminta Kementerian Perdagangan (Kemendag) untuk memerintahkan para distributor untuk memasok minyak goreng ke pasar tradisional, bukan hanya ke ritel modern. Menurutnya hal ini bertujuan agar masyarakat tidak membeli minyak goreng di ritel modern saja, sehingga stok minyak goreng di ritel modern tidak minim.</p>', 'langkanya-minyang-goreng-dipasaran.jpg', 'langkanya-minyang-goreng-dipasaran', NULL, NULL, 0, '2022-03-10 04:10:12', NULL, '2022-04-05 00:51:39', NULL),
(3, 3, 'Membuat Kue Coklat', '<p>Resep brownies:<br>- 150 gr dark cooking chocolate (dcc)<br>- 35 gr cokelat bubuk<br>- 50 gr margarin<br>- 40 ml minyak<br>- 135 gr gula pasir diblender<br>- 100 gr tepung terigu pro sedang<br>- 2 butir telur<br>- sejumput garam</p><p>Bahan cheesecake:<br>- 200 gr cheesecake<br>- 50 gr margarin<br>- 40 gr gula pasir diblender<br>- 30 gr tepung terigu<br>- 1 sdt vanilla esscence<br>- 1 butir kuning telur</p><p>Cara membuat:<br>1. Buat adonan brownies, dcc dan margarin dilelehkan.<br>2. Kocok telur dan gula pasir halus sampai gula larut, lalu tambahkan coklat, margarin, dan minyak. Aduk rata.<br>3. Tambahkan tepung terigu dan cokelat bubuk, sedikit garam aduk kembali, sampai tidak ada gumpalan.<br>4. Masukkan ke loyang, sisakan sedikit adonan.<br>5. Kemudian kocok cheesecake dan margarin dengan whisker atau mixer kecepatan rendah.<br>6. Tambahkan gula pasir halus, kuning telur dan terigu, masukkan di atas adonan brownies.<br>7. Masukkan kembali sisa adonan brownies di atasnya dan ditusuk acak dengan tusuk gigi.<br>8. Jika menggunakan loyang sekat bisa ditambahkan aneka toping.<br>9. Panggang dengan suhu 170 derajat celcius, dalam waktu 30 menit.</p>', 0, 'Membuat Kue Coklat', '<p>Resep brownies:<br>- 150 gr dark cooking chocolate (dcc)<br>- 35 gr cokelat bubuk<br>- 50 gr margarin<br>- 40 ml minyak<br>- 135 gr gula pasir diblender<br>- 100 gr tepung terigu pro sedang<br>- 2 butir telur<br>- sejumput garam</p><p>Bahan cheesecake:<br>- 200 gr cheesecake<br>- 50 gr margarin<br>- 40 gr gula pasir diblender<br>- 30 gr tepung terigu<br>- 1 sdt vanilla esscence<br>- 1 butir kuning telur</p><p>Cara membuat:<br>1. Buat adonan brownies, dcc dan margarin dilelehkan.<br>2. Kocok telur dan gula pasir halus sampai gula larut, lalu tambahkan coklat, margarin, dan minyak. Aduk rata.<br>3. Tambahkan tepung terigu dan cokelat bubuk, sedikit garam aduk kembali, sampai tidak ada gumpalan.<br>4. Masukkan ke loyang, sisakan sedikit adonan.<br>5. Kemudian kocok cheesecake dan margarin dengan whisker atau mixer kecepatan rendah.<br>6. Tambahkan gula pasir halus, kuning telur dan terigu, masukkan di atas adonan brownies.<br>7. Masukkan kembali sisa adonan brownies di atasnya dan ditusuk acak dengan tusuk gigi.<br>8. Jika menggunakan loyang sekat bisa ditambahkan aneka toping.<br>9. Panggang dengan suhu 170 derajat celcius, dalam waktu 30 menit.</p>', 'membuat-kue-coklat.jpg', 'membuat-kue-coklat', NULL, NULL, 1, '2022-03-24 09:14:22', NULL, '2022-04-05 00:39:03', NULL),
(14, 3, 'Resep Lotus Biscoff Cheese Cake', '<p>Lotus Biscoff Cheesecake yang viral satu Malaysia. Dikenali juga sebagai Lotus Speculoos, kat Europe panggil speculoos, dan biasanya di UK dan US dipanggil biscoff. Selain cream cheese&hellip;2 bahan utama cheesecake ni adalah Lotus Biscoff cookies, dan Lotus Biscoff spread. Kemudian Ada 3 bahagian, iaitu untuk buat base, kedua untuk filling tengah iaitu adunan cheese, dan ketiga, hiasan topping atas cheesecake.Rujuk video untuk cara nak dapatkan dripping effect yang cantik pada hujung video.</p>', 0, 'Resep', '<p>resep</p>', 'VYvv_Z-BBew', 'resep-lotus-biscoff-cheese-cake', NULL, NULL, 1, '2022-06-06 09:22:05', NULL, '2022-06-06 09:26:18', NULL),
(15, 3, 'Membuat Pisang Enak', '<p>It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using &#39;Content here, content here&#39;, making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for &#39;lorem ipsum&#39; will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</p>', 0, NULL, NULL, 'membuat-pisang-enak.png', 'membuat-pisang-enak', 'askdskadnksan', 'sadsad', 1, '2022-08-01 09:28:08', NULL, '2022-08-01 09:28:08', NULL);
